import React, { Component } from 'react';
import { Link } from 'react-router-dom';
import CustomerService from '../services/CustomerService';
import {Dropdown} from "bootstrap";
import { Button } from 'bootstrap';
import AuthService from '../services/AuthService';

class NavbarComponent extends Component {
    constructor(props){
        super(props)

    }

    logOut(e){
        e.preventDefault()
        AuthService.logout()

    }
    render() {
        return (
            <div>
                <header>
                    <nav className="navbar navbar-expand-md navbar-dark bg-dark">

                    <div><h3 className='navbar-brand'>Flight Management</h3></div>

                    <Link to={"/flights"}className='nav-link nav-left'>Flights</Link>

                   <Link to={"/add-customer"}className='nav-link nav-right'>Register</Link>
                   {localStorage.getItem("user")?(
                       <button onClick={this.logOut}>Log Ouy</button>
                   ):(
                   <Link to={"/sign-in"} className='nav-link text-right'>Sign In</Link>
                   )
                   }
                    <div></div>
                    </nav>
                </header>
            </div>
        );
    }
}

export default NavbarComponent;
